<h3>2.1 控制反转 (IoC)</h3>
<ul>
<li><strong>依赖注入 (DI)</strong>：Spring 的核心功能之一。通过将对象的依赖关系从代码中分离出来，实现了对象创建和管理的灵活性。依赖注入可以通过配置文件或注解来定义。</li>
