<h3>1. 模块（Modules）</h3>
<ul>
<li>
<p><strong>定义</strong><br>
模块是 Angular 应用的基本构建块。每个模块封装了一组相关的功能和组件。通过模块，开发者可以将应用分割成更小的、可重用的部分。</p>
</li>
<li>
<p><strong>根模块</strong><br>
